function downloadGantt(type) {
	var name = $('#saveInput').length>0?$("#saveInput").val():$('#fileTitleInput').val();
	if(type=='gantt'){
		download(JSON.stringify(ge.saveProject()), name+".gantt", "application/json");
	}else if(type=='json'){
		download(JSON.stringify(ge.saveProject()), name+".json", "application/json");
	}else if(type=='png'){
		$('.rowSelected').removeClass('rowSelected');
		$("#gtTable").tableExport({fileName:name,type:"png",escape:"false"});
	}else if(type=='txt'){
		$("#gtTable").tableExport({fileName:name,type:"txt",escape:"false"});
	}else if(type=='csv'){
		$("#gtTable").tableExport({fileName:name,type:"csv",escape:"false"});
	}else if(type=='xls'){
		$("#gtTable").tableExport({fileName:name,type:"excel",escape:"false"});
	}else if(type=='doc'){
		$("#gtTable").tableExport({fileName:name,type:"word",escape:"false"});
	}
}
