var localFileId=null,initTxt=null,initTitle=null,filetb;
function getStrSize(txt){let size=txt.replace(/[^\u0000-\u00ff]/g,"aa").length;const arr=['B','KB','MB','GB','TB'];let sizeUnit=0;while(size>1024){size/=1024;++sizeUnit;}return size.toFixed(0)+arr[sizeUnit];}
function insertAfter(a,b){var parent=b.parentNode;if(parent.lastChild==b){parent.appendChild(a,b)}else{parent.insertBefore(a,b.nextSibling)}};
function localDB(callback,params) {
	var indexedDB = window.indexedDB || window.webkitIndexedDB || window.mozIndexedDB || window.msIndexedDB;
    if(!indexedDB){return false;} 
	var request = window.indexedDB.open('iodrawdb',1);
	request.onsuccess = function (event) {
		var iodrawdb = request.result;
		filetb = iodrawdb.transaction(['file'], 'readwrite').objectStore('file');
		return callback(params);
	};
	request.onupgradeneeded = function (event) {
		var iodrawdb = event.target.result;
		if (!iodrawdb.objectStoreNames.contains('file')) {
			filetb = iodrawdb.createObjectStore('file', { keyPath: 'id' });
			filetb.createIndex('title', 'title', { unique: true });
			return callback(params);
		}
	}
}
function saveFile(params) {
	var type=params.type,title=params.title,txt=params.txt;
	if(initTxt==null||initTitle==null){initTxt=txt;initTitle=title;return false}
	if(initTxt==txt&&initTitle==title){return false}
	if(params.id!=null){
		var getOne=filetb.get(params.id);getOne.onsuccess=function(event){if(getOne.result){
		var db=getOne.result;
		if(txt==db.txt&&title==db.title){return false}
		db.txt=txt;db.size=getStrSize(txt);db.updateTime=new Date();db.syncCount=0;db.syncTime=null;
		if(title!=db.title){db.title=title;var requestQuery=window.indexedDB.open('iodrawdb',1);requestQuery.onsuccess=function(event){filetb=requestQuery.result.transaction(['file'],'readwrite').objectStore('file');
			var queryTitle=filetb.index('title').get(title);
			queryTitle.onsuccess=function(e){var result=e.target.result;
				if (result!=null && result.id!=db.id){
					params.title=getNewFileTitle(title);
					localDB(saveFile,params);
					return false;
				}
			}}	
		}
		var requestUpadate=window.indexedDB.open('iodrawdb',1);requestUpadate.onsuccess=function(event){filetb=requestUpadate.result.transaction(['file'],'readwrite').objectStore('file');
			var updateDB=filetb.put(db);
			updateDB.onsuccess=function(event){
				initTitle=db.title,initTxt=db.txt;
				document.getElementById("fileTitleInput").value=db.title.substring(0,db.title.lastIndexOf("."));
				changeFileTitleInput();
				showFileMsg();
				uploadBaiduPan(db);
			}
			updateDB.onerror=function(event){}
		}}}
	}else{
		var queryTitle=filetb.index('title').get(title);
		queryTitle.onsuccess=function(e){
			var result = e.target.result;
			if (result!=null) {
				params.title=getNewFileTitle(title);
				localDB(saveFile,params);
				return false;
			}
		}
		var requestAdd = window.indexedDB.open('iodrawdb',1);
		requestAdd.onsuccess=function(event){filetb=requestAdd.result.transaction(['file'],'readwrite').objectStore('file');
			var now=new Date();
			var obj={id:now.getTime(),title:title,type:type,size:getStrSize(txt),updateTime:now,txt:txt,status:1,syncTime:null,syncCount:0,syncTitle:null};
			var addDB = filetb.add(obj);
			addDB.onsuccess=function(event){
				localFileId=obj.id;
				initTitle=title,initTxt=txt;
				document.getElementById("fileTitleInput").value=title.substring(0,title.lastIndexOf("."));
				changeFileTitleInput();
				showFileMsg();
				uploadBaiduPan(obj);
			}
			addDB.onerror=function(event){}
		}	
	}
}
function uploadBaiduPan(obj){
	var baiduToken=localStorage.getItem("baiduToken");
	var baiduUinfo=localStorage.getItem("baiduUinfo");
	var syncBaiduPanTime=localStorage.getItem("syncBaiduPanTime");
	if(baiduToken==null){return false}
	if(baiduUinfo==null||baiduUinfo==""){return false}
	if(syncBaiduPanTime!=null&&(new Date().getTime()-syncBaiduPanTime)<60*1000){return false}
	if(obj.syncCount>3){return false}
	if(obj.txt.replace(/[^\u0000-\u00ff]/g,"aa").length>1*1024*1024){return false}
	localStorage.setItem("syncBaiduPanTime",new Date().getTime());
	obj.syncCount=obj.syncCount+1;
	var request1=window.indexedDB.open('iodrawdb',1);request1.onsuccess=function(event){filetb=request1.result.transaction(['file'],'readwrite').objectStore('file');
	var update1=filetb.put(obj);
	update1.onsuccess=function(event){
		var oldSyncTitle=obj.syncTitle;
		var xhr=new XMLHttpRequest();
		xhr.open('POST',"/member/fileSave.json",true);
		xhr.setRequestHeader('content-type','application/json;charset=utf-8;');
		xhr.send(JSON.stringify({"title":(oldSyncTitle==null?obj.title:oldSyncTitle),"token":baiduToken,"txt":obj.txt}));
		xhr.onreadystatechange=function(){
			if (xhr.readyState==4&&xhr.status==200) {
				if(xhr.responseText=="0"){
					obj.syncCount=0;
					obj.syncTime=new Date();
					obj.syncTitle=obj.title;
					var request2=window.indexedDB.open('iodrawdb',1);request2.onsuccess=function(event){filetb=request2.result.transaction(['file'],'readwrite').objectStore('file');
					var update2=filetb.put(obj);
					update2.onsuccess=function(event){
						if(oldSyncTitle!=null && oldSyncTitle!=obj.title){
							var xhr2=new XMLHttpRequest();
							xhr2.open('POST',"/member/fileRename.json?oldName="+oldSyncTitle+"&newName="+obj.title+"&token="+baiduToken,true);
							xhr2.send();
						}
					}}
				}else if(xhr.responseText=="-6"){
					localStorage.removeItem("baiduUinfo");
					localStorage.removeItem("baiduToken");
					localStorage.removeItem("baiduFiles");
				}
			}
		}
	}}
}
function getNewFileTitle(title){
	var fileName=title.substring(0,title.lastIndexOf("."));
	var fileSuffix=title.substring(title.lastIndexOf("."));
	var suffix=fileName.lastIndexOf("-")<0?0:fileName.substring(fileName.lastIndexOf("-")+1);
	var prefix=fileName.lastIndexOf("-")<0?fileName:fileName.substring(0,fileName.lastIndexOf("-"));
	var newSuffix=(/^\d+$/.test(suffix)==true)?(parseInt(suffix)+1):1;
	return prefix+"-"+newSuffix+fileSuffix;
}
